import React from 'react';
import './index.css';
import ReactDOM from 'react-dom';
import App from './App';
import { AuthProvider } from './Auth/AuthProvider';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

    <AuthProvider>
      <App />
    </AuthProvider>
);
